export const actionSetvalue= (intvalue) => {
    return {
        intvalue,
        type: 'SETVALUE'
    }
}

export const SetLoginstate= (loginstate) => {
    return {
        loginstate,
        type: 'SETLOGINSTATE'
    }
}

export const actionDecrement = () => {
    return {
        type: 'DECREMENT'
    }
}
